package platinmods.menu.pmt;

import android.app.Activity;
import android.app.AlertDialog;
import android.content.Intent;
import android.net.Uri;
import android.os.Bundle;
import android.os.Handler;
import android.provider.Settings;
import android.widget.Toast;

public class SetupActivity extends Activity
{
    public static String image = "";

    @Override
    protected void onCreate(Bundle savedInstanceState)
    {
        super.onCreate(savedInstanceState);

        new AlertDialog.Builder(this)
                .setTitle("Jasmur VIP Pmt Menu by Wergity")
                .setMessage("Github: @WergityMods\nTelegram: @Wergity_Mods")
                .setCancelable(false)
                .setPositiveButton("OK", (dialog, which) -> dialog.dismiss())
                .show();

        if (Settings.canDrawOverlays(this))
        {
            Intent intent = new Intent(SetupActivity.this, Reborn.class);
            new Handler().postDelayed(() -> startService(intent), 4000);
        }
        else
        {
            Intent intent = new Intent();
            intent.setData(Uri.parse("package:" + getPackageName()));
            intent.setAction("android.settings.action.MANAGE_OVERLAY_PERMISSION");

            new AlertDialog.Builder(this)
                    .setMessage("Please grant draw over app permission to continue using our mod!")
                    .setCancelable(false)
                    .setPositiveButton("OK", (dialog, which) -> startActivity(intent))
                    .show();
        }

        for (int i = 0; i < 5; i++)
        {
            Toast.makeText(this,
                    "modded by Jasmur \nwww.platinmods.com - Gamehacks & more!",
                    Toast.LENGTH_LONG
            ).show();
        }
    }
}
